	real function zjlut(nv,val,ichoose,anodes,nva,nrec,table)
	implicit none
	integer nv
	real val(nv)
	
	logical ichoose(nv,2**nv)
	real anodes(mxn,nv)
	integer nva(nv),nrec
	real table(nrec)
	
!-----	
	real value_table, swx,wx,rmin,rmax,trlui
	integer i,j,ik,k,iv,in
	integer  iva(nv,2**nv)
	
	real wb(nv),wt(nv),rva(nv)
	integer ibase(nv),itop(nv)
	
	val(1) =  flcen(ifix(val(1))) !!! Fu-Liou Band to cm-1 for lookup
	if ( jlut%mode == 'water')val(1) = 10000./val(1)
!	print*,val(1)
!--------------------
	 VSET : do iv=1,nv 
	rmin = anodes(1,iv)
	rmax = anodes(nva(iv),iv)

	if (val(iv) <= rmin )then 
	  rva(iv) = 1
	elseif (val(iv) >= rmax ) then
	  rva(iv) = nva(iv)
	else

	FNODES : do in = 1,nva(iv)-1
	if( val(iv) >= anodes(in,iv) .and. val(iv) < anodes(in+1,iv) ) &
        rva(iv)= in+( val(iv)-anodes(in,iv)) /			      &
      		    (anodes(in+1,iv)-anodes(in,iv))
	enddo FNODES

	endif

!	print*,iv,rva(iv)
	enddo VSET
!---------------------

	 ibase = floor(rva)
	 where( ibase < 1) ibase=1

	 itop= ceiling(rva)
	 where( itop > nva) itop=nva

	wb=1.0-(rva-ibase)
	wt=1.0-wb
	
!	print'(A10,10f5.1)','Exact',rva(1:nv)
!	print'(A10,10I5)','BASE',ibase
!	print'(A10,10I5)','TOP',itop
!	print'(A10,10f5.1)','Wb',wb	
!	print'(A10,10f5.1)','Wt',wt

	swx=0 ; trlui =0 ; ik=0

	NODE : do j=1,2**nv
	wx=1.0

	 DIMENSION: do i=1,nv

	 if( ichoose(i,j) ) then
	  iva(i,j) = itop(i)
	  wx=wx*wt(i)
	 else
	  iva(i,j) = ibase(i)
	  wx=wx*wb(i)
	 endif

	 enddo DIMENSION

	 if( wx > 0 ) then
	 ik=ik+1
	 k = ilui(nv,nva,iva(1,j))

	 value_table = table(k)

	 swx       = swx  +               wx
	 trlui      = trlui + value_table * wx

!	print'(2I4,i10,4f10.5,10I4)',ik,j,k,value_table ,wx,swx,trlui,iva(1:nv,j)
!	if (swx >= 0.9999 )exit
	endif

	enddo NODE
	zjlut = trlui/swx
	return
	end function zjlut
	
